import {GET_JOB_ASSIGNMENTS} from '../types';

const jobassignments = (state = [], action) => {
	switch(action.type) {
		case GET_JOB_ASSIGNMENTS:
			return [...action.payload];
		default:
			return state;
	}
}

export default jobassignments;
